package main

import (
    "fmt"
    "sort"
)

func main() {
    n := 0
    for {
        t1, _ := fmt.Scan(&n)
        if t1 != 0 {
            strs := generateParenthesis(n)
            fmt.Printf("{")
            for _, s := range strs {
                fmt.Printf("\"%s\", ", s)
            }
            fmt.Printf("}")
        } else {
            return
        }
    }
}

// 默认代码模版
func generateParenthesis(n int) []string {
    if n == 1 {
        return []string{"()"}
    }

    temp := make(map[string]int)
    res := make([]string, 0)
    strs := generateParenthesis(n-1)
    for _, s := range strs {
        for i := 0; i < len(s); i++ {
            for j := i; j < len(s); j++ {
                str := s[:i] + "(" + s[i:j] + ")" + s[j:]
                if isValid(str) {
                    if _, ok := temp[str]; ok {
                   // 
                    } else {
                        temp[str] = 1
                        res = append(res, str)
                    }
                }
            }
        }
    }
    sort.Strings(res)
    return res
}

// 20. 有效的括号 代码
func isValid(str string) bool {
    if len(str) == 0 {
        return true
    }
    stack := make([]byte, 0)
    stack = append(stack, '0')
    //(){}[]
    for i := 0; i < len(str); i++ {
        if str[i] == '(' || str[i] == '[' || str[i] == '{' {
            stack = append(stack, str[i])
            continue
        }
        end := len(stack)-1
        switch str[i] {
        case ')':
            if stack[end] == '(' {
                stack = stack[:end]
                break
            } else {
                return false
            }
        case ']':
            if stack[end] == '[' {
                stack = stack[:end]
                break
            } else {
                return false
            }
        case '}':
            if stack[end] == '{' {
                stack = stack[:end]
                break
            } else {
                return false
            }
        default:
            return false
        }
    }
    if len(stack) == 1 {
        return true
    } else {
        return false
    }
}


